import React from "react";
import "../../sass/style.sass";

class CardBackground extends React.Component {
  render() {
    return (
      <div className="row">
        <div className="card col-3">
          <h1>fond de la carte</h1>
        </div>
      </div>
    );
  }
}

export default CardBackground;
